/*${AOs::SumoHSM::CheckDistAndMove} ........................................*/
static uint8_t SumoHSM_CheckDistAndMove(SumoHSM * const me) {
    (void)me;
    if (distance_is_active(DIST_SENSOR_F)){
        drive(100,100);
    } else if (distance_is_active(DIST_SENSOR_FR) && distance_is_active(DIST_SENSOR_FL)){
        drive(100,100);
    } else if (distance_is_active(DIST_SENSOR_FR)) {
        drive(20,-20);
    } else if (distance_is_active(DIST_SENSOR_FL)) {
        drive(-20,20);
    } else if (distance_is_active(DIST_SENSOR_DR)) {
        drive(40,-40);
    } else if (distance_is_active(DIST_SENSOR_DL)) {
        drive(-40,40);
    } else if (distance_is_active(DIST_SENSOR_R)) {
        drive(80,-80);
    } else if (distance_is_active(DIST_SENSOR_L)) {
        drive(-80,80);
    } else {
       return false;
    }
    return true;
}

/*${AOs::SumoHSM::CheckDistAndMoveDefense} .................................*/
static uint8_t SumoHSM_CheckDistAndMoveDefense(SumoHSM * const me) {
    (void)me;
    if (distance_is_active(DIST_SENSOR_F)&&
        distance_is_active(DIST_SENSOR_FR) && distance_is_active(DIST_SENSOR_FL)){
        drive(100,100);
    } else if (distance_is_active(DIST_SENSOR_FR) && distance_is_active(DIST_SENSOR_FL)){
        drive(0,0);
        return false;
    } else if (distance_is_active(DIST_SENSOR_FR)) {
        drive(20,-20);
    } else if (distance_is_active(DIST_SENSOR_FL)) {
        drive(-20,20);
    } else if (distance_is_active(DIST_SENSOR_DR)) {
        drive(40,-40);
    } else if (distance_is_active(DIST_SENSOR_DL)) {
        drive(-40,40);
    } else if (distance_is_active(DIST_SENSOR_R)) {
        drive(80,-80);
    } else if (distance_is_active(DIST_SENSOR_L)) {
        drive(-80,80);
    } else {
        return false;
    }
    return true;
}

/*${AOs::SumoHSM::UpdateCustomStrategy} ....................................*/
static void SumoHSM_UpdateCustomStrategy(SumoHSM * const me) {
    uint8_t current_step = cust_strategy_current_step();
    if (current_step >= cust_strategy_num_steps()){
        QEvt evt = { .sig = EXIT_CUSTOM_SIG };
        QHSM_DISPATCH(&AO_SumoHSM->super, &evt, SIMULATOR);
    } else {
        movement_t step_type = cust_strategy_move_type(current_step);
        uint16_t movement_parameter = cust_strategy_move(current_step);

        switch (step_type) {
            case MOVE_FRONT:{
                imu_set_setpoint(imu_get_setpoint());
                imu_set_base_speed(100);
                if (movement_parameter > 0){
                    uint16_t movement_delay_ms = get_time_to_move_ms(movement_parameter, 100, &parameters);
                    QTimeEvt_rearm(&me->timeEvt, BSP_TICKS_PER_MILISSEC * movement_delay_ms);
                } else {
                    QEvt evt = { .sig = EXIT_CUSTOM_SIG };
                    QHSM_DISPATCH(&AO_SumoHSM->super, &evt, SIMULATOR);
                }
                break;
            }
            case MOVE_BACK: {
                imu_set_setpoint(imu_get_setpoint());
                imu_set_base_speed(-100);
                if (movement_parameter > 0){
                    uint16_t movement_delay_ms = get_time_to_move_ms(movement_parameter, 100, &parameters);
                    QTimeEvt_rearm(&me->timeEvt, BSP_TICKS_PER_MILISSEC * movement_delay_ms);
                } else {
                    QEvt evt = { .sig = EXIT_CUSTOM_SIG };
                    QHSM_DISPATCH(&AO_SumoHSM->super, &evt, SIMULATOR);
                }
                break;
            }
            case MOVE_TURN:
                imu_set_setpoint(movement_parameter);
                imu_set_base_speed(0);
                break;
            default: {
                QEvt evt = { .sig = EXIT_CUSTOM_SIG };
                QHSM_DISPATCH(&AO_SumoHSM->super, &evt, SIMULATOR);
                break;
            }
        }
    }

}

