    /*${AOs::SumoHSM::SM::initial} */
    (void)par;

    QTimeEvt_armX(&me->timeEvt_2, BSP_TICKS_PER_MILISSEC * 10, 0);
    me->buzzerCount = 0U;

    QS_FUN_DICTIONARY(&SumoHSM_Idle);
