/*${AOs::SumoHSM::SM::AutoWait} */
static QState SumoHSM_AutoWait_e(SumoHSM * const me) {
    drive(0,0);
    driving_disable();
    board_led_on();
    ble_service_send_string("state:AUTO");
    parameters_set_strategy_led(&parameters);
    parameters_set_pre_strategy_led(&parameters);
    radio_service_en_radio_data_sig(false);
    me->stuck_counter = 0;
    me->step_counter = 0;
    parameters.attack_when_near = false;
    start_module_enable();
    set_reference_voltage();

    QEvt evt_restart_imu = { .sig = IMU_RESTART_SIG };
    QHSM_DISPATCH(&imu_service_AO->super, &evt_restart_imu, SIMULATOR);
    return QM_ENTRY(&SumoHSM_AutoWait_s);
}
/*${AOs::SumoHSM::SM::AutoWait} */
static QState SumoHSM_AutoWait_x(SumoHSM * const me) {
    QTimeEvt_disarm(&me->timeEvt);
    return QM_EXIT(&SumoHSM_AutoWait_s);
}
