/*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Custom} .....................*/
/*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Custom} */
static QState SumoHSM_PreStrategy_PreStrategy_Custom_e(SumoHSM * const me) {
    // Max timeout to be in pre strategy state
    QTimeEvt_rearm(&me->timeEvtStuck, BSP_TICKS_PER_MILISSEC * 400);
    cust_strategy_reset();
    SumoHSM_UpdateCustomStrategy(me);
    return QM_ENTRY(&SumoHSM_PreStrategy_PreStrategy_Custom_s);
}
/*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Custom} */
static QState SumoHSM_PreStrategy_PreStrategy_Custom(SumoHSM * const me, QEvt const * const e) {
    QState status_;
    switch (e->sig) {
        /*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Cust~::TIMEOUT} */
        case TIMEOUT_SIG: {
            // Timeout occurs when parameter is front or back
            cust_strategy_increase_step();
            SumoHSM_UpdateCustomStrategy(me);
            status_ = QM_HANDLED();
            break;
        }
        /*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Cust~::EXIT_CUSTOM} */
        case EXIT_CUSTOM_SIG: {
            static QMTranActTable const tatbl_ = { /* tran-action table */
                &SumoHSM_PreStrategy_s, /* target submachine */
                {
                    Q_ACTION_NULL /* zero terminator */
                }
            };
            status_ = QM_TRAN_XP(me->sub_PreStrategy->XP1, &tatbl_);
            break;
        }
        /*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Cust~::LINE_CHANGED_BL, LINE_CHANGED_BR} */
        case LINE_CHANGED_BL_SIG: /* intentionally fall through */
        case LINE_CHANGED_BR_SIG: {
            static struct {
                QMState const *target;
                QActionHandler act[2];
            } const tatbl_ = { /* tran-action table */
                &SumoHSM_PreStrategy_PreStrategy_1_sub1_s, /* target state */
                {
                    Q_ACTION_CAST(&SumoHSM_PreStrategy_PreStrategy_1_sub1_e), /* entry */
                    Q_ACTION_NULL /* zero terminator */
                }
            };
            status_ = QM_TRAN(&tatbl_);
            break;
        }
        /*${AOs::SumoHSM::SM::PreStrategy::PreStrategy_Cust~::IMU_UPDATED} */
        case IMU_UPDATED_SIG: {
            // if (move left or right) and near_set_point, change parameter

            int8_t l_speed = 0;
            int8_t r_speed = 0;

            int8_t ret = imu_pid_process(&l_speed, &r_speed);

            if (ret == 0){
                drive(l_speed, r_speed);
            }

            uint8_t current_step = cust_strategy_current_step();
            movement_t step_type = cust_strategy_move_type(current_step);

            if (step_type == MOVE_TURN && near_set_point()) {
                cust_strategy_increase_step();
                SumoHSM_UpdateCustomStrategy(me);
            }

            status_ = QM_HANDLED();
            break;
        }
        default: {
            status_ = QM_SUPER();
            break;
        }
    }
    return status_;
}

